namespace Shine
{
	/** 区域形状类型(generated by shine) */
	export class RegionShapeType
	{
		/** 圆形(arg0:x,arg1:z,arg2:半径) */
		public static Circle:number=1;
		
		/** 矩形(arg0:x,arg1:z,arg2:宽,arg3:高) */
		public static Rect:number=2;
		
		/** 网格(arg0:meshID) */
		public static Mesh:number=3;
		
		/** 长度 */
		public static size:number=4;
		
	}
}
